import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

function Welcome(props) {
  return (
  <p>Hello {props.nameS}!</p>
)}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Welcome nameS='Dsadss'/>
  </React.StrictMode>
);
